const logger = require('./logger.js');
const imagemagick = require('imagemagick-native');
const fs = require('fs');
const rp = require('request-promise');
let savePath = "";
const cv = require('opencv');
let Promise = require('bluebird');

function getFaces(image, callback) {
    image.detectObject(cv.FACE_CASCADE, {}, function (err, faces) {
        // logger.log("Face lenght :" + faces.length);
        const size = image.height();
        let actualFace = null;
        let actualFaceSize = 20;
        let faceArray = [];
        let resp = null;
        for (let i = 0; i < faces.length; i++) {
            const x = faces[i];
            image.rectangle([x.x, x.y], [x.width, x.height], [0, 250, 0], 2);
            const im2 = image.roi(x.x - 0, x.y - 0, x.width + 0, x.height + 0);
            const sizeFace = x.height;
            if ((actualFaceSize < sizeFace)) {
                if ((size / sizeFace < 7)) {
                    faceArray = [];
                    actualFaceSize = sizeFace;
                    faceArray.push(im2);
                    actualFace = im2;
                    resp = im2;
                }
                else {
                    logger.log(size + "/" + sizeFace + "=" + size / sizeFace);
                    resp = 1;
                }

            }
        }/*
        if (resp != null && resp != 1) {
            resp.save('./outG.jpg');
        }*/
        callback(resp);
    });
}
function getEyes(image, callback) {
    image.detectObject(cv.EYES_PAIR_CASCADE, {}, function (err, eyes) {
        for (let y = 0; y < eyes.length; y++) {
            const o = eyes[y];
            image.ellipse(o.x + o.width / 2, o.y + o.height / 2, o.width / 2, o.height / 2, [255, 0, 0], 5);
            callback(o);

        }
    });
}


function getGlasses(image, callback) {
    image.detectObject(cv.MOUTH_CASCADE, {}, function (err, mouth) {
        logger.log("Image size :" + image.width());

        for (let y = 0; y < mouth.length; y++) {
            const o = mouth[y];
            logger.log(o.width + "&" + image.width());
            if (o.width > (image.width() * 0.1)) {
                image.ellipse(o.x + o.width / 2, o.y + o.height / 2, o.width / 2, o.height / 2, [255, 0, 0], 2);
                callback(o);
                logger.log(o.width + "&" + image.width() * image.height());
                image.save('./outG' + y + '.jpg');
            }
        }
    });
}


function base64ToBinary(base64Data) {
    return new Buffer(base64Data.replace(/data.*base64,/, ''), 'base64');
}

const checkIfFaceExist = function (method, image) {
    return new Promise(function (done, reject) {
        switch (method) {
            case 'url' :
                rp({
                    uri: image,
                    encoding: null
                }).then(function (remoteBuf) {
                    try {
                        cv.readImage(remoteBuf, function (err, im) {
                            getFaces(im, function (result) {
                                if (!result) {
                                    logger.log("no face found");
                                    done(3);
                                }
                                if (result == 1) {
                                    logger.log("Vous etes trop loin");
                                    done(2);
                                }
                                else {
                                    logger.success('Face found :' + result.width());
                                    done(1);
                                }
                            });
                        })
                    }
                    catch (err) {
                        logger.error(err);
                        reject(new Error(err))
                    }
                });
                break;
            case 'base64' :
                try {
                    cv.readImage(base64ToBinary(image), function (err, im) {
                        getFaces(im, function (result) {
                            if (!result) {
                                logger.log("no face found");
                                done(3);

                            }
                            if (result == 1) {
                                logger.log("Vous etes trop loin");
                                done(2);
                            }
                            else {
                                logger.success('Face found :' + result.width());
                                done(1);
                            }
                        });
                    })
                }
                catch (err) {
                    logger.error(err);
                    reject(new Error(err))
                }

                break;

            case 'file' :
                try {
                    cv.readImage(image, function (err, im) {
                        getFaces(im, function (result) {
                            if (!result) {
                                logger.log("no face found");
                                done(3);
                            }
                            if (result == 1) {
                                logger.log("Vous etes trop loin");
                                done(2);
                            }
                            else {
                                logger.success('Face found :' + result.width());
                                done(1);
                            }
                        });
                    });
                }
                catch (err) {
                    // logger.error(err);
                    reject(new Error(err))
                }

                break;
        }
    });
};


const imageFromBase64 = function (data, name, options, callback) {
    let str = data.split(",").pop();
    let buf = new Buffer(str, 'base64');
    try {
        fs.writeFileSync(name, imagemagick.convert({
            srcData: buf,
            format: 'jpg',
            gravity: 'Center',
            width: options.x,
            height: options.y,
            resizeStyle: 'aspectfill',
            quality: options.quality, // (best) to 1 (worst)
            blur: options.blur
        }));
        callback(null, name);
    } catch (err) {
        callback(err, null);
    }
};

const imageFromFile = function (filePath, name, options, callback) {
    try {
        let data = fs.readFileSync(filePath);
        fs.writeFileSync(name, imagemagick.convert({
            srcData: data,
            format: 'jpg',
            gravity: 'Center',
            width: options.x,
            height: options.y,
            resizeStyle: 'aspectfill',
            quality: options.quality,
            blur: options.blur
        }));
        callback(null, name);
    } catch (err) {
        callback(err, null);
    }
};

let imageFromUrl = function (data, name, options, callback) {
    rp({
        uri: data,
        encoding: null
    }).then(function (test) {
        try {
            fs.writeFileSync(name, imagemagick.convert({
                srcData: test,
                format: 'jpg',
                gravity: 'Center',
                width: options.x,
                height: options.y,
                resizeStyle: 'aspectfill',
                quality: options.quality,
                blur: options.blur
            }));
            callback(null, name);
        } catch (err) {
            callback(err, null);
        }
    }).catch(function (err) {
        callback(err, null);
    });


};


module.exports = {
    checkIfFaceExist,

    imageFromBase64,

    imageFromUrl,

    imageFromFile,

    getThumbail: function (method, data, name) {
        let options = {
            'x': 10,
            'y': 10,
            'quality': 100,
            'blur': 15
        };
        name = savePath + name + "-thumbail.jpg";
        return new Promise(function (done, reject) {
            switch (method) {
                case 'url' :
                    imageFromUrl(data, name, options, function (err, res) {
                        if (err) {
                            return reject(new Error(err))
                        }
                        done(res);
                    });

                    break;
                case 'base64' :
                    imageFromBase64(data, name, options, function (err, res) {
                        if (err) {
                            return reject(new Error(err))
                        }
                        done(res);
                    });
                    break;
                case 'file' :
                    imageFromFile(data, name, options, function (err, res) {
                        if (err) {
                            return reject(new Error(err))
                        }
                        done(res);
                    });
                    break;

            }
        });
    },
    getProfile: function (method, data, name) {
        let options = {
            'x': 800,
            'y': 800,
            'quality': 90,
            'blur': 0
        };
        name = savePath + name + "-profil.jpg";
        return new Promise(function (done, reject) {
            switch (method) {
                case 'url' :
                    imageFromUrl(data, name, options, function (err, res) {
                        if (err) {
                            return reject(new Error(err))
                        }
                        done(res);
                    });

                    break;
                case 'base64' :
                    imageFromBase64(data, name, options, function (err, res) {
                        if (err) {
                            return reject(new Error(err))
                        }
                        done(res);
                    });
                    break;
                case 'file' :
                    imageFromFile(data, name, options, function (err, res) {
                        if (err) {
                            return reject(new Error(err))
                        }
                        done(res);
                    });
                    break;
            }
        });
    },


    image: 'data:image/jpeg;base64,'
};